    "SC.AALP.AIAssistant.Help.AIWorks.Intro3": "Ask a legal research question just the way you think about it, as if you were giving instructions to a colleague. Please see our tips for best results for questions this feature does not yet support and suggestions for improving results.",
    "SC.AALP.AIAssistant.Help.AIWorks.ReviewAICourtRules": "Review AI Court Rules and Orders",
