    "SC.AALP.AIAssistant.Help.AIWorks.Button.Title": "How the AI works",
    "SC.AALP.AIAssistant.Help.AIWorks.Title": "How AI-Assisted Research works",
    "SC.AALP.AIAssistant.Help.AIWorks.HelperModals": "Read {howItWorksButton} and get {tipsButton}.",
    "SC.AALP.AIAssistant.Help.AIWorks.Info1": "AI-Assisted Research uses large language models - a type of generative AI - and focuses the models on the language of cases, statutes, and other primary law to improve accuracy.",
    "SC.AALP.AIAssistant.Help.AIWorks.Info2": "In addition, primary law is referenced in the responses with the actual language from the source, and links are included to read the full primary law documents. Even with these and other precautions, AI-Assisted Research can occasionally produce inaccuracies, so it should always be used as part of a research process in connection with additional research to fully understand the nuance of the issues and further improve accuracy.",
    "SC.AALP.AIAssistant.Help.AIWorks.Info3": "<strong>The AI-generated summary of results above the list of primary law authority can be extraordinarily useful for getting an overview of the issues and pointers to primary authority, but it should <em>never</em> be used to advise a client, write a brief or motion for a court, or otherwise be relied on without doing further research.</strong>",
    "SC.AALP.AIAssistant.Help.AIWorks.Info4": "Use it to accelerate thorough research. <strong>Don't use it as a <em>replacement</em> for thorough research.</strong>",
    "SC.AALP.AIAssistant.Help.AIWorks.Info5": "Visit the AI Court Rules page to review the court rules, orders that update court rules, proposed and adopted legislation, and select orders from individual judges that address the use of artificial intelligence in legal research and drafting. Please consult all applicable rules of practice prior to filing documents that rely on AI-based tools.",
    "SC.AALP.AIAssistant.Help.AIWorks.LearnMore.Button.Title": "how the AI works",
    "SC.AALP.AIAssistant.Help.Tips.FocusedQuery.Block": "Content Block",
