    "SC.AALP.AIAssistant.Help.Tips.AvoidProperName.BetterQuery": "Can a company executive be held personally liable in a shareholder derivative action?",
    "SC.AALP.AIAssistant.Help.Tips.AvoidProperName.Heading": "Avoid including proper names of people or parties",
    "SC.AALP.AIAssistant.Help.Tips.AvoidProperName.Paragraph": "Using proper names can artificially focus the search on results that may only be moderately relevant but contain the same name.",
    "SC.AALP.AIAssistant.Help.Tips.ComingSoon.Heading": "Additional suggestions",
    "SC.AALP.AIAssistant.Help.Tips.ComingSoon.Paragraph": "AI-Assisted Research does not yet support the following tasks, but we're working on them and you can expect to see many of them in the future.",
    "SC.AALP.AIAssistant.Help.Tips.ComingSoon.FindByCitation": "Finding documents by citation, such as \"5 U.S. 137\"",
    "SC.AALP.AIAssistant.Help.Tips.ComingSoon.BooleanQuery": "Boolean or fielded queries, such as \"summary judgment\" /p \"breach of contract\"",
    "SC.AALP.AIAssistant.Help.Tips.ComingSoon.AnalyticsRequests": "Requests for analytics, such as \"Which law firm has the most torts cases in 2023 so far?\"",
    "SC.AALP.AIAssistant.Help.Tips.ComingSoon.TaskCommands": "Commands to execute certain tasks, such as \"Summarize the Jones v. Smith case\" or \"Email me the Jones v. Smith case and any cases that have negative KeyCite treatment\"",
    "SC.AALP.AIAssistant.Help.Tips.ComingSoon.ComprehensiveDocs": "Requests for comprehensive document retrievals, such as \"Find all cases granting summary judgment on negligent misrepresentation claims\"",
    "SC.AALP.AIAssistant.Help.Tips.ComingSoon.TimingMathCalc": "Requests for timing or mathematical calculations, such as \"By which date do I need to file a notice of appeal for a judgment entered on July 8th\"",
    "SC.AALP.AIAssistant.Help.Tips.ComingSoon.PredictionsOutcome": "Questions about predictions of outcomes, such as \"Will the Supreme Court overturn the Chevron doctrine?\"",
    "SC.AALP.AIAssistant.Help.Tips.ComingSoon.CompareAcrossJuris": "Requested comparisons across many jurisdictions, such as \"How does each state address the privacy of data stored on a mobile device?\"",
    "SC.AALP.AIAssistant.Help.Tips.ComingSoon.RequestedSummaries": "Requested summaries of how the law has changed over time.",
    "SC.AALP.AIAssistant.Help.Tips.ComingSoon.CitationFormatting": "Requests for standard or other rule set citation formatting, such as \"Put this citation in official format 2011 NY Slip Op 05178\"",
    "SC.AALP.AIAssistant.Help.Tips.ComingSoon.SpecificParties": "Questions about specific parties or judges, such as \"Find all the copyright opinions written by Richard Posner\"",
    "SC.AALP.AIAssistant.Help.Tips.ComingSoon.LocalCourtRules": "Requests for how local court rules apply, such as \"What are the rules in San Diego County regarding ex parte applications in probate matters?\"",
    "SC.AALP.AIAssistant.Help.Tips.ComingSoon.RequestLegalDocumentDraft": "Requests to draft a specific legal document, such as \"Draft a motion for continuance in state court\"",
    "SC.AALP.AIAssistant.Help.Tips.FocusedQuery.Heading": "Write a clear, concise, and focused query that is 1-2 sentences long",
    "SC.AALP.AIAssistant.Help.Tips.FocusedQuery.Paragraph": "Consider adding information, such as practice area, cause of action, governing law, remedy sought, desired outcome, or material facts to provide better context for the query.",
    "SC.AALP.AIAssistant.Help.Tips.FocusedQuery.Query": "What are the defenses to a securities fraud claim?",
    "SC.AALP.AIAssistant.Help.Tips.FocusedQuery.BetterQuery": "In a suit under Section 10(b) of the Securities Exchange Act of 1934 and SEC Rule 10b-5, an investor alleges that the company made false representations regarding the company's future earnings, but the company claims it did not know that the statement to the investor was false or misleading when it was made. What defenses are available to the company?",
    "SC.AALP.AIAssistant.Help.Tips.ProvideFacts.Heading": "Provide relevant facts",
    "SC.AALP.AIAssistant.Help.Tips.ProvideFacts.Paragraph": "Do not include extra background facts that are not material to the question. Each term in a query should be essential to finding relevant information.",
    "SC.AALP.AIAssistant.Help.Tips.ProvideFacts.Query": "A disabled employee returns from leave after sustaining a back injury. They are unable to return to their previous hospital position which required lifting patients and other heavy objects, so they request an open clerical position. They are only minimally qualified to perform the clerical work, though they could be trained. Is the employer required to offer the position to the returning disabled employee under the ADA?",
    "SC.AALP.AIAssistant.Help.Tips.ProvideFacts.BetterQuery": "Does the ADA require an employer to reassign an employee to a vacant position as a reasonable accommodation?",
    "SC.AALP.AIAssistant.Help.Tips.NoStylePromptCommand.Heading": "Do not write a query in the style of a prompt, command, or instruction",
    "SC.AALP.AIAssistant.Help.Tips.NoStylePromptCommand.Paragraph": "We have done the prompting and instruction work for you and have designed AI-Assisted Research to work best with legal research queries that clearly identify the information you would like to find. For example, it is better to avoid including extra words or phrases like \"find cases that…\" that bookend the query but are not substantive. Instead, it is better to construct a query with words or phrases you would expect to find in cases, statutes, or regulations.",
    "SC.AALP.AIAssistant.Help.Tips.NoStylePromptCommand.Query": "You are an experienced attorney who is an expert legal researcher, and you need to find and summarize the best cases that discuss whether the ADA requires an employer to reassign an employee to a vacant position as a reasonable accommodation.",
    "SC.AALP.AIAssistant.Help.Tips.NoStylePromptCommand.BetterQuery": "Does the ADA require an employer to reassign an employee to a vacant position as a reasonable accommodation?",
    "SC.AALP.AIAssistant.Help.Tips.SingleIssue.Heading": "Focus on a single issue or question",
    "SC.AALP.AIAssistant.Help.Tips.SingleIssue.Paragraph": "Where it is easy to distinguish separate issues, ask about those issues in separate questions dedicated to the issues, rather than combining them.",
    "SC.AALP.AIAssistant.Help.Tips.SingleIssue.Query": "Does the ADA require an employer to reassign an employee to a vacant position as a reasonable accommodation and has an employee satisfied their requirement of providing notice of their disability to the employer by asking to be reassigned to the vacant position?",
    "SC.AALP.AIAssistant.Help.Tips.SingleIssue.BetterQuery": "Does the ADA require an employer to reassign an employee to a vacant position as a reasonable accommodation?",
    "SC.AALP.AIAssistant.Help.Tips.SingleIssue.BetterQuery2": "Does an employee's request to be reassigned to a vacant position because it requires less physical strength constitute providing notice of their disability or condition under the ADA?",
