    "SC.AskPL.AIAssistant.LandingPage.Answers.Intro3": "Ask a legal research question just the way you think about it, as if you were giving instructions to a colleague. Please see our tips for best results for questions this feature does not yet support and suggestions for improving results.",
    "SC.AskPL.AIAssistant.LandingPage.Answers.Intro4": "{plAskPlusName} uses large language models and can occasionally produce inaccuracies, so it should always be used as part of a research process in connection with additional research where Practical Law resources are checked to fully understand the nuance of the issues and further improve accuracy.",
    "SC.AskPL.AIAssistant.LandingPage.ResearchMemo.Locked": "Answers in your History are now read-only. You can review them and access any linked resources, but they can't be changed or continued.",
    "SC.AskPL.AIAssistant.Toolbar.Title.AriaLabel": "New {plAskPlusName}",
    "SC.AskPL.AIAssistant.Toolbar.Feature.New": "New",
    "SC.AskPL.AIAssistant.Toolbar.Feature.Beta": "Beta",
    "SC.AskPL.AIAssistant.AIWorks.Info": "{plAskPlusName} uses large language models - a type of generative AI - and focuses the models on the text of Practical Law resources to improve accuracy.<br/><br/>In addition, Practical Law resources are referenced in the responses with the actual language from the resources, and links are included to read the full Practical Law documents. Even with these and other precautions, {plAskPlusName} can occasionally produce inaccuracies, so it should always be used as part of a research process in connection with additional research to fully understand the nuance of the issues and further improve accuracy.<br/><br/><b>The AI-generated summary of results above the list of Practical Law resources can be extraordinarily useful for getting an overview of the issues and pointers to source documents, but it should <i>never</i> be used to advise a client or otherwise be relied on without doing further research.</b><br/><br/>Use it to accelerate thorough research. <b>Don't use it as a <i>replacement</i> for thorough research.</b>",
    "SC.AskPL.AIAssistant.AIWorks.Tips.Info1": "<strong>Ask your question in everyday language.</strong> Include key facts and details, when possible.",
    "SC.AskPL.AIAssistant.AIWorks.Tips.Info2": "<strong>Use specific terms.</strong> For example, \"Is the waiver of consequential damages enforceable under New York law?\" Or \"How can I strengthen a payment terms provision in a Sale of Goods agreement for my buyer client?\"",
    "SC.AskPL.AIAssistant.AIWorks.Tips.Info3": "<strong>Provide feedback on results.</strong> Indicating whether results were helpful or not will help improve this tool.",
