    "SC.Foldering.ResearchOrganizer.Graphical.Info.Title": "Graphical View",
    "SC.Foldering.ResearchOrganizer.Graphical.Info.GeneralDesc": "Graphical View of History provides detailed visualizations of your previous Westlaw activity so that you can more efficiently retrace your steps and pick up where you left off with prior research.",
    "SC.Foldering.ResearchOrganizer.Graphical.Info.OrganizationHeader": "Organization of Graphical View",
    "SC.Foldering.ResearchOrganizer.Graphical.Info.OrganizationDesc1": "Graphical View of History is organized into separate anchor events, such as searches and document retrievals, which mark the beginning of each visualization.  Clicking on any anchor event in the list will open a visualization that maps out your subsequent research events, step-by-step, including filters you applied, documents you viewed, and KeyCite tabs you opened.  Each event is numbered to show the exact order of your steps.  There is also a mini-map in the bottom right corner that helps you maintain a high level view of your current location within the visualization while panning and zooming to view different events.",
    "SC.Foldering.ResearchOrganizer.Graphical.Info.OrganizationDesc2": "In addition, you can click on any event in the visualization to open a preview containing additional details, including the notes or highlights you added to a document or the complete list of filters you applied.  The preview also provides a link to reopen that event in a separate browser tab.",
    "SC.Foldering.ResearchOrganizer.Graphical.Info.OrganizationDesc3": "To start a new anchor event and accompanying visualization, simply enter a new search or document citation in the main search bar.",
    "SC.Foldering.ResearchOrganizer.Graphical.Info.HighActivityHeader": "High Activity",
    "SC.Foldering.ResearchOrganizer.Graphical.Info.HighActivityDesc": "To help you quickly identify documents you might have considered important in your prior research, the documents with which you had the most interaction will be highlighted and labeled as “high activity.”  To determine high activity, Graphical View employs an algorithm, which tracks how much relative interaction you had with each document in the visualization.  Interactions factored into this calculation include delivering, foldering, annotating, linking to other documents, opening KeyCite tabs, using Copy with Reference, setting a KeyCite Alert, and spending more than two minutes viewing the document.  Documents with which you had no interactions and viewed for less than two minutes will be considered “low activity” and will display as smaller event boxes.  These features, along with others, can be turned on or off by clicking the gear icon in the visualization.",
    "SC.Foldering.ResearchOrganizer.Graphical.Info.TimeSpentHeader": "Time Spent",
    "SC.Foldering.ResearchOrganizer.Graphical.Info.TimeSpentDesc": "Each anchor event will show the total amount of time that you spent on events within that visualization.  Additionally, each document view event will show you how much time you spent actively viewing that document.  These times are approximate and should not be relied on for client billing purposes.",
    "SC.Foldering.ResearchOrganizer.Graphical.Info.BillingHeader": "Billing",
    "SC.Foldering.ResearchOrganizer.Graphical.Info.BillingDesc": "The same billing rules for History apply to both Graphical View and List View.  Transactional billing users can re-access events the same day without incurring an additional charge (in the US and Canada until 2:00 AM Central Time; in the UK until 2:00 AM local time; in Australia until 3:00 AM local time).",
