    "SC.FormsAssembly.ClientPortal.Constants.Messages.UploadHelp": "<div>All your uploaded documents are listed on this page. You may sort the list by clicking on the heading. Remove any item from this list by clicking the remove link. Your firm will still be able to view documents that you have removed. <h4>How to Upload a Document:</h4><ol><li>Click the browse button to find the document on your computer that you wish to upload.</li><li>If you have more than one open case with your firm, assign the document to the correct case.</li><li>Click the upload button to share the document with your firm.</li></ol></div>",
