    "SC.Report.DocAnalyzer.ProgressTray.Title": "Quick Check",
    "SC.Report.DocAnalyzer.OnBoardingTour.Recommendations.Step1": "On the <b>Recommendations</b> tab you’ll find cases and other materials relevant to the issues in the analyzed document but that were not cited in it.",
    "SC.Report.DocAnalyzer.OnBoardingTour.Recommendations.Step2.Part1": "<span>A.</span> Quick Check provides focused recommendations for each section of the analyzed document. The report is organized according to the <b>headings</b> within the document and can be filtered to focus only on the issues you are most interested in.",
    "SC.Report.DocAnalyzer.OnBoardingTour.Recommendations.Step2.Part2": "<span>B.</span> Easily see how a case might be useful with <b>relevant language</b> and <b>outcomes</b>. Quick Check analyzes the language of the analyzed document to tailor the report and pinpoint the most relevant parts of the recommended cases for quick review.",
    "SC.Report.DocAnalyzer.OnBoardingTour.Recommendations.Step3.Part1": "<span>A.</span> <b>Case details</b> provides information about the procedural background of the recommended case.",
    "SC.Report.DocAnalyzer.OnBoardingTour.Recommendations.Step3.Part2": "<span>B.</span> Quick Check also alerts you when one of the recommended cases is related to some of the <b>cases already cited</b> in the analyzed document.",
    "SC.Report.DocAnalyzer.OnBoardingTour.Recommendations.Step3.Part3": "<span>C.</span> Case <b>tags</b> highlight when a case has been frequently cited, is from the high court in its jurisdiction, or was decided in the last 2 years.",
    "SC.Report.DocAnalyzer.OnBoardingTour.Warnings.Step1": "The <b>Warnings for cited authority</b> tab allow you to verify that the authority cited within the analyzed document is still good law.",
    "SC.Report.DocAnalyzer.OnBoardingTour.Warnings.Step2.Part1": "<span>A.</span> For cases that have any negative <b>KeyCite</b> treatment, including Westlaw Edge's exclusive KeyCite Overruling Risk warnings, Quick Check identifies the <b>relevant language</b> from within the treating case to let you know why the KeyCite flag exists.",
    "SC.Report.DocAnalyzer.OnBoardingTour.Warnings.Step2.Part2": "<span>B.</span> Citation <b>tags</b> highlight when a case was decided 10 or more years ago, or when a case is not commonly cited to in judicial opinions.",
    "SC.Report.DocAnalyzer.OnBoardingTour.TOA.Step1.Part1": "The <b>Table of authorities</b> tab contains the full list of all the cases cited in the analyzed document, regardless of whether we found a KeyCite issue or not. Use this to quickly review and deliver all the cited cases in a document.",
    "SC.Report.DocAnalyzer.OnBoardingTour.TOA.Step1.Part2": "<b>Depth of discussion</b> provides a visual preview of how much a citation was discussed in the analyzed document.  Citations with deeper discussion may merit more thorough review.",
    "SC.Report.DocAnalyzer.OnBoardingTour.Opponent.TakeTour": "Quick Check is a next-generation document analysis tool. Quick Check leverages your opponent’s document to create a quickly-reviewable report that allows you to check the opponent’s cited cases for potential weaknesses and recommends relevant contrary and omitted authority that traditional research may have missed. <br><br>Would you like a brief tour?",
    "SC.Report.DocAnalyzer.OnBoardingTour.Opponent.Warnings.Step1": "The <b>Warnings for cited authority</b> tab allows you to review the authority cited within the analyzed document to see if any are no longer good law.",
    "SC.Report.DocAnalyzer.OnBoardingTour.Opponent.Warnings.Step2.Part1": "<span>A.</span> For cases that have any negative <b>KeyCite</b> treatment, including Westlaw Edge's exclusive KeyCite Overruling Risk warnings, Quick Check identifies the <b>relevant language</b> from within the treating case to let you know why the KeyCite flag exists.",
    "SC.Report.DocAnalyzer.OnBoardingTour.Opponent.Warnings.Step2.IndigoPremium.Part1": "<span>A.</span> For cases that have any negative <b>KeyCite</b> treatment, including Westlaw Precision's KeyCite Overruling Risk warnings, Quick Check identifies the <b>relevant language</b> from within the treating case to let you know why the KeyCite flag exists.",
    "SC.Report.DocAnalyzer.OnBoardingTour.Opponent.Warnings.Step2.Part2": "<span>B.</span> Citation <b>tags</b> highlight when a case was decided 10 or more years ago, or when a case is not commonly cited to in judicial opinions.",
    "SC.Report.DocAnalyzer.OnBoardingTour.Opponent.Warnings.Step2.Part3": "<span>C.</span> See cases that have <b>distinguished</b> themselves from the case cited in the opponent’s analyzed document.  Use this link to find cases that potentially undermine an opponent’s cited authority.",
    "SC.Report.DocAnalyzer.OnBoardingTour.Opponent.TOA.Step1": "The <b>Table of authorities</b> tab contains the full list of all the cases cited in the analyzed document, regardless of whether we found a KeyCite issue or not. Use this to quickly review and deliver all the cited cases in a document.",
    "SC.Report.DocAnalyzer.OnBoardingTour.Opponent.Recommendations.Step1": "On the <b>Recommendations</b> tab you’ll find cases and other materials relevant to the issues in the analyzed document but that were not cited in it. Quick Check prioritizes finding cases that may undermine an opponent’s position, based on the content of the analyzed document.",
    "SC.Report.DocAnalyzer.OnBoardingTour.Opponent.Recommendations.Step2": "The top of the report contains <b>details about the analyzed document</b>.  Quick Check identifies these details to help you better understand how the case recommendations below might oppose the opponent’s position.  If you need to correct something, you can edit the information to ensure the report’s accuracy.",
    "SC.Report.DocAnalyzer.OnBoardingTour.Opponent.Recommendations.Step3.Part1": "<span>A.</span> Quick Check provides focused recommendations for each section of the analyzed document. The report is organized according to the <b>headings</b> within the document and can be filtered to focus only on the issues you are most interested in.",
    "SC.Report.DocAnalyzer.OnBoardingTour.Opponent.Recommendations.Step3.Part2": "<span>B.</span> Easily see how a case might be useful with <b>relevant language</b> and <b>outcomes</b>. Quick Check analyzes the language of the analyzed document to tailor the report and pinpoint the most relevant parts of the omitted cases for quick review.",
    "SC.Report.DocAnalyzer.OnBoardingTour.Opponent.Recommendations.Step4.Part1": "<span>A.</span> <b>Case details</b> provides information about the procedural background of the recommended case.  Compare these to the details from the analyzed document to see how the recommendation might be helpful.",
    "SC.Report.DocAnalyzer.OnBoardingTour.Opponent.Recommendations.Step4.Part2": "<span>B.</span> Quick Check also alerts you when one of the recommend cases is related to a specific piece of relevant text or citations <b>from the opponent’s document</b>.",
    "SC.Report.DocAnalyzer.OnBoardingTour.Opponent.Recommendations.Step4.Part3": "<span>C.</span> <b>Recommendation tags</b> in the report indicate when a recommended case contains <b>contrary authority</b> that might help oppose the positions in the analyzed document and when the recommendation originated from the <b>same motion type</b>. Other tags highlight when a case has been <b>frequently cited</b>, is from the <b>high court</b> in its jurisdiction, or was decided in the <b>last 2 years</b>.",
