    "SC.Report.QuickCheck.SelectedText.OnBoardingTour.TakeTour": "Quick Check is a next-generation document analysis tool. Quick Check leverages your selected text to create a quickly-reviewable report that contains relevant authority that traditional research may have missed and allows you to review the cited cases to see if they are still good law. <br><br>Would you like a brief tour?",
    "SC.Report.QuickCheck.SelectedText.OnBoardingTour.Recommendations.Step1": "On the <b>Recommendations</b> tab you’ll find cases and other materials relevant to the issues in the selected text but were not cited in it.",
    "SC.Report.QuickCheck.SelectedText.OnBoardingTour.Recommendations.Step2.Part1": "<span>A.</span> Your selected text from the original document appears at the top to provide context for the recommendations.",
    "SC.Report.QuickCheck.SelectedText.OnBoardingTour.Recommendations.Step2.Part2": "<span>B.</span> Easily see how a case might be useful with <b>relevant language</b> and <b>outcomes</b>. Quick Check analyzes the language of the selected text to tailor the report and pinpoint the most relevant parts of the recommended cases for quick review.",
    "SC.Report.QuickCheck.SelectedText.OnBoardingTour.Recommendations.Step3.Part1": "<span>A.</span> <b>Case details</b> provides information about the procedural background of the recommended case.",
    "SC.Report.QuickCheck.SelectedText.OnBoardingTour.Recommendations.Step3.Part2": "<span>B.</span> Case <b>tags</b> highlight when a case has been frequently cited, is from the high court in its jurisdiction, or was decided in the last 2 years.",
    "SC.Report.QuickCheck.SelectedText.OnBoardingTour.Warnings.Step1": "The <b>Warnings for cited authority</b> tab allow you to verify that the authority cited within the selected text is still good law.",
    "SC.Report.QuickCheck.SelectedText.OnBoardingTour.Warnings.Step2.Part1": "<span>A.</span> For cases that have any negative <b>KeyCite</b> treatment, including Westlaw Edge's exclusive KeyCite Overruling Risk warnings, Quick Check identifies the <b>relevant language</b> from within the treating case to let you know why the KeyCite flag exists.",
    "SC.Report.QuickCheck.SelectedText.OnBoardingTour.Warnings.Step2.Part2": "<span>B.</span> Citation <b>tags</b> highlight when a case was decided 10 or more years ago, or when a case is not commonly cited to in judicial opinions.",
    "SC.Report.QuickCheck.SelectedText.OnBoardingTour.TOA.Step1.Part1": "The <b>Table of authorities</b> tab contains the full list of all the cases cited within the selected text, regardless of whether we found a KeyCite issue or not. Use this to quickly review and deliver all the cited cases.",
    "SC.Report.QuickCheck.SelectedText.OnBoardingTour.TOA.Step1.Part2": "<b>Depth of discussion</b> provides a visual preview of how much a citation was discussed in the selected text. Citations with deeper discussion may merit more thorough review.",
    "SC.Report.QuickCheck.SelectedText.OnBoardingTour.Quotations.Step1": "The <b>Quotation analysis</b> tab allows you to compare quotations from the selected text to the language in the cited documents on Westlaw.",
