    "SC.Report.QuickCheck.Judicial.OnBoardingTour.Button.Finish": "Finish",
    "SC.Report.QuickCheck.Judicial.OnBoardingTour.Card.AltText": "QuickCheck Judicial Tour Image",
    "SC.Report.QuickCheck.Judicial.OnBoardingTour.CitedAuthority1": "The <b>Cited authority</b> tab contains a list of authority cited in the analyzed documents that can be found on Westlaw.",
    "SC.Report.QuickCheck.Judicial.OnBoardingTour.CitedAuthority2.Part1": "<span>A.</span> Below each cited document you’ll see which parties have cited it and in which document(s) it was found. Any authority that has been <b>cited by both parties</b> receives a special <b>tag</b> for quick review.",
    "SC.Report.QuickCheck.Judicial.OnBoardingTour.CitedAuthority2.Part2": "<span>B.</span> For cases that have any negative <b>KeyCite</b> treatment, including Westlaw Edge's exclusive KeyCite Overruling Risk warnings, Quick Check Judicial identifies the <b>relevant language</b> from within the treating case to let you know why the KeyCite flag exists.",
    "SC.Report.QuickCheck.Judicial.OnBoardingTour.Hint.CitedAuthority": "Click on Cited authority tab",
    "SC.Report.QuickCheck.Judicial.OnBoardingTour.Hint.OmittedAuthority": "Click on Omitted authority tab",
    "SC.Report.QuickCheck.Judicial.OnBoardingTour.Hint.QuotationsAnalysis": "Click on Quotations analysis tab",
    "SC.Report.QuickCheck.Judicial.OnBoardingTour.Quotations1": "The <b>Quotation analysis</b> tab allows you to compare case quotations from the uploaded documents to the language in the cited case on Westlaw.",
    "SC.Report.QuickCheck.Judicial.OnBoardingTour.Quotations2": "<b>Differences</b> are flagged when a quotation from an uploaded document does not match the cited language on Westlaw.",
    "SC.Report.QuickCheck.Judicial.OnBoardingTour.Quotations3": "Sort each document’s quotations to show differences first or by the order of appearance in the document.",
    "SC.Report.QuickCheck.Judicial.OnBoardingTour.Quotations3.NewSort": "Sort the document’s quotations by potential severity or by the order of appearance in the document.",
    "SC.Report.QuickCheck.Judicial.OnBoardingTour.OppLightboxContent": "Quick Check Judicial uses next-generation artificial intelligence to analyze the uploaded documents from both sides of a matter to create a quickly reviewable report of relevant authority that the parties failed to cite and provides helpful information about the cited authority and quotations found across the filings. <br><br>Would you like a brief tour?",
    "SC.Report.QuickCheck.Judicial.OnBoardingTour.OmittedAuthority": "On the <b>Omitted authority</b> tab you’ll find cases and other materials relevant to the issues in the uploaded documents but that were not cited in them.",
    "SC.Report.QuickCheck.Judicial.OnBoardingTour.OmittedByBoth1.Header": "The <b>Omitted by both</b> tab provides relevant cases cited by neither party.",
    "SC.Report.QuickCheck.Judicial.OnBoardingTour.OmittedByBoth1.Part1": "<span>A.</span> <b>Case details</b> provides information about the procedural background of the recommended case.",
    "SC.Report.QuickCheck.Judicial.OnBoardingTour.OmittedByBoth1.Part2": "<span>B.</span> Recommendation <b>tags</b> highlight when a case has been frequently cited, is from the high court in its jurisdiction, or was decided in the last 2 years.",
    "SC.Report.QuickCheck.Judicial.OnBoardingTour.OmittedByBoth2.Part1": "<span>A.</span> Summary information and <b>outcomes</b> for each issue are provided for each case. Gavel icons emphasize the outcomes most relevant to the issues in the uploaded document(s).",
    "SC.Report.QuickCheck.Judicial.OnBoardingTour.OmittedByBoth2.Part2": "<span>B.</span> Quick Check lists the <b>headings</b> from the uploaded document(s) for which the case is relevant. Expand each heading to see details about why the case was recommended for those legal issues.",
    "SC.Report.QuickCheck.Judicial.OnBoardingTour.OmittedAuthorityByParty.Header": "The <b>Omitted by party</b> tab provides recommended authority relevant to headings in each document assigned to a specific party.",
    "SC.Report.QuickCheck.Judicial.OnBoardingTour.OmittedAuthorityByParty.Part1": "<span>A.</span> Quick Check Judicial provides focused recommendations for each section of the uploaded documents. The report is organized according to the <b>headings</b> within the documents and can be filtered to focus only on the issues in which you’re most interested.",
    "SC.Report.QuickCheck.Judicial.OnBoardingTour.OmittedAuthorityByParty.Part2": "<span>B.</span> Easily see how a case might be useful with <b>relevant language and outcomes</b>. Quick Check Judicial analyzes the language of the uploaded documents to tailor the report and pinpoint the most relevant parts of the recommended case for quick review.",
    "SC.Report.QuickCheck.Judicial.OnBoardingTour.OmittedAuthorityByParty.Part3": "<span>C.</span> Quick Check Judicial also alerts you when one of the recommended cases is related to some of the <b>cases already cited</b> in the uploaded document.",
    "SC.Report.QuickCheck.Judicial.OnBoardingTour.LightboxContent": "Quick Check is a next-generation document analysis tool. Quick Check Judicial leverages the analyzed documents from both sides of a matter to create a quickly-reviewable report that contains relevant authority that the parties failed to cite and allows you to review the cited authority and quotations found across the filings. <br><br>Would you like a brief tour?",
    "SC.Report.QuickCheck.Judicial.CitedAuthority.Facets.CitedByPartyTitle": "Cited by party",
