    "SC.Search.PoweredByWestSearchBox.title": "WestSearch&trade;",
    "SC.Search.PoweredByWestSearchBox.Content.para1": "WestSearch&trade; is the world's most advanced legal search engine. It leverages over 100 years of West's editorial analysis of the law, and it emulates the best practices of experienced legal researchers.",
    "SC.Search.PoweredByWestSearchBox.Content.itemsHeading": "Key components of WestSearch&trade;:",
    "SC.Search.PoweredByWestSearchBox.Content.item1.Title": "West Key Number System&reg;",
    "SC.Search.PoweredByWestSearchBox.Content.item1": "This is the foundation of WestSearch&trade;. Because thousands of West attorney editors have read, summarized and classified the law by topic for over 100 years, WestSearch&trade; can identify the topics of law best represented by the terms of your search and return highly relevant documents for those topics, even if the documents don't have the terms you put into the search box.",
    "SC.Search.PoweredByWestSearchBox.Content.item2.Title": "KeyCite&reg;",
    "SC.Search.PoweredByWestSearchBox.Content.item2": "KeyCite maps the citation network among all federal and state cases in the West National Reporter System&trade; (as well as over 1 million unpublished cases), federal and state statutes, and thousands of secondary source publications. WestSearch&trade; analyzes the rich connections among documents, making your results more inclusive and bringing the most relevant documents to the top of the list.",
    "SC.Search.PoweredByWestSearchBox.Content.item3.Title": "West Secondary Sources",
    "SC.Search.PoweredByWestSearchBox.Content.item3": "With thousands of practice guides, legal encyclopedias, and authoritative treatises, WestSearch&trade; can find primary law that is heavily discussed in each jurisdiction and detect similar phrases that apply to your concepts",
    "SC.Search.PoweredByWestSearchBox.Content.para2": "Whether you run a precise Boolean Terms & Connectors search or just enter simple descriptive terms, WestSearch&trade; employs West's editorial assets much like an expert researcher would &ndash; only faster &ndash; to find the best documents for your research.",
