    "SC.Search.Bellows.Search.SearchPanel.MouseOverInfo.NoOlderThan": "Alerts retrieve documents that have been loaded to Westlaw subsequent to the last time the alert was run.  Some documents  are not immediately available for electronic loading to Westlaw. Such documents thus may have a publication date (news articles), a decided date (case law), or a filed date (court documents) that occurs sometime in the past. \"Documents No Older Than\" allows you to limit your results to those documents that were published, decided, or filed within the number of days you specify. Using this feature will ensure that your results include only documents with publication, decision, or filing dates within the specified number of days regardless of the date they were loaded to and available on Westlaw.",
    "SC.Search.Bellows.Search.SearchPanel.MouseOverInfo.SmartTermsInfo": "Search Smart Terms independently or in conjunction with your terms and connectors search.  When used together the & (and) connector is applied and cannot be changed. <a id=\"co_detailedSmartTermsLink\" href=\"javascript:void(0);\"> Click for detailed SmartTerms help.</a>",
