    "SC.Search.SearchWidget.MedicalLitigator.ExpandedTermText": "Use Expanded Terms",
    "SC.Search.AdvanceSearch.SmartTermsWidget.HelpBox.Intro": "Use <strong>Smart Terms</strong> to narrow your news searches by Industry, Subject, Location, and Company. Smart Terms are assigned to a document based on the subject represented, so they do not need to appear in the text of a document in order to retrieve that document. For example, a news article that discusses the commercial release of a newly developed medical device is assigned the Smart Term <em>Medical Devices</em> even though it doesn't mention the terms <em>medical</em> or <em>device</em>.",
