    "SC.Search.AdvanceSearch.SmartTermsWidget.HelpBox.AddingSmartTerms.Title": "Adding Smart Terms to your News Query",
    "SC.Search.AdvanceSearch.SmartTermsWidget.HelpBox.AddingSmartTerms.Description": "To add one or more Smart Terms to your News Query, complete these steps",
    "SC.Search.AdvanceSearch.SmartTermsWidget.HelpBox.AddingSmartTerms.Item1": "On the News Advanced Search Template, type your desired search terms in your desired fields. <strong>Note: </strong>if you want to run a search that searches for Smart Terms only, then skip to Step 2.",
    "SC.Search.AdvanceSearch.SmartTermsWidget.HelpBox.AddingSmartTerms.Item2": "Click the <strong>Select Smart Terms</strong> link.",
    "SC.Search.AdvanceSearch.SmartTermsWidget.HelpBox.AddingSmartTerms.Item3": "Select the <strong>Industry</strong>, <strong>Subject</strong>, <strong>Company</strong>, or <strong>Location</strong> tab. If you select the <strong>Company</strong> tab, search for a company by typing its common name (e.g., general mills), ticker symbol (e.g., GIS), or SIC code in the text box. From the drop down menus, select <strong>Name</strong>, <strong>Ticker</strong>, or <strong>SIC</strong>, and <strong>Begins With</strong>, <strong>Contains</strong>, or <strong>Exact Phrase</strong>. Click <strong>Search</strong>. Click <strong>ADD</strong> next to each company you wish to include in your search.</li>",
    "SC.Search.AdvanceSearch.SmartTermsWidget.HelpBox.AddingSmartTerms.Item4": "Browse or search the outline that is displayed, clicking <strong>ADD</strong> to add your desired Smart Terms.",
    "SC.Search.AdvanceSearch.SmartTermsWidget.HelpBox.AddingSmartTerms.Item5": "Repeat steps 3-4 to add Smart Terms from other tabs. When you are finished selecting Smart Terms, click <strong>Save</strong>.",
    "SC.Search.AdvanceSearch.SmartTermsWidget.HelpBox.AddingSmartTerms.Item6": "Your selected Smart Terms will appear in the query at the top of the screen. Click the <strong>Search </strong>button to run the search.",
    "SC.Search.AdvanceSearch.SmartTermsWidget.HelpBox.Notes.Title": "Notes",
    "SC.Search.AdvanceSearch.SmartTermsWidget.HelpBox.Notes.Item1": "Smart Terms are added to the Terms and Connectors search with the & (AND) connector. You cannot change this connector.",
    "SC.Search.AdvanceSearch.SmartTermsWidget.HelpBox.Notes.Item2": "You are able to search exclusively with Smart Terms; a Terms and Connectors query is not required.",
    "SC.Search.AdvanceSearch.SmartTermsWidget.HelpBox.Notes.Item3": "By default, the Smart Terms you select within a category; e.g., Industry, are separated with the <strong>OR</strong> connector, meaning one or both terms must be in the document for it to be retrieved. To change the connector between two terms, use the drop-down box appearing between the multiple selections from the same category. Select <strong>AND</strong> if both terms must appear in the document for it to be retrieved; or select <strong>NOT</strong> to exclude documents that contain the terms following <strong>NOT</strong>. If you select Smart Terms from more than one category, e.g., Industry and Company, the categories are separated with the &amp; (AND) connector. You cannot change this connector.",
    "SC.Search.AdvanceSearch.SmartTermsWidget.HelpBox.Notes.Item4": "Industry, Subject, and Location Smart Terms will not be highlighted in your search results.",
    "SC.Search.AdvanceSearch.SmartTermsWidget.HelpBox.SearchForSmartTerms.Title": "Search for Smart Terms",
    "SC.Search.AdvanceSearch.SmartTermsWidget.HelpBox.SearchForSmartTerms.Description": "To search for Industry, Subject or Location Smart Terms, select the desired tab. Search using the text box located below the tab, using the drop down menu to select <strong>Begins With</strong>, <strong>Contains</strong>, or <strong>Exact Phrase</strong>. For example, to search for terms in the automotive industry, click the <strong>Industry</strong> tab and type <strong>automobile</strong> in the text box. Then select <strong>Begins With</strong> from the drop-down list and click <strong>Search</strong>.",
