    "SC.Widgets.App.ToolsSection.DailyBulletin.LabelText": "Daily Bulletin",
    "SC.Widgets.App.ToolsSection.KnowledgeGraph.Description": "Navigate Practical Law content and discover related issues with ease. Knowledge Map's visual display allows you to quickly gain insights, accelerate your research, and be confident that you have uncovered related issues.",
    "SC.Widgets.App.ToolsSection.QuickCompare.LabelText": "Quick Compare",
    "SC.Widgets.App.ToolsSection.QuickCompare.Description": "Build customizable charts comparing legal requirements across multiple jurisdictions at-a-glance. Quick Compare allows you to easily see the data points you are comparing while also allowing you to see more detail when you choose.",
    "SC.Widgets.App.ToolsSection.WhatsMarketAnalytics.LabelText": "What's Market",
    "SC.Widgets.App.ToolsSection.WhatsMarketAnalytics.Description": "Spend less time searching for precedent deal terms and market trends. Use What's Market's expert-drafted deal summaries to find, compare, and analyze public filings and agreements.",
    "SC.Widgets.App.ToolsSection.MatterMaps.LabelText": "Matter Maps",
    "SC.Widgets.App.ToolsSection.MatterMaps.OldDescription": "Quickly map the tasks related to your matter and find the Practical Law resources to support you each step of the way. Our Practical Law experts have mapped out the tasks associated with common legal matters and curated the relevant resources so you can get to work faster.",
    "SC.Widgets.App.ToolsSection.MatterMaps.NewDescription": "Make Matter Maps your own by adding new tasks from scratch and customizing your tasks and resources. Customized maps allow you to focus on the tasks and resources you are interested in, in the order you need, and to share your map with others as you need.",
    "SC.Widgets.App.ToolsSection.AutomatedDocuments.LabelText": "Automated Documents",
    "SC.Widgets.App.ToolsSection.AutomatedDocuments.Description": "Complete your first draft faster with Automated Documents. Building on Practical Law's expert-drafted Standard Documents, answer a series of questions and generate your first draft automatically.",
    "SC.Widgets.App.ToolsSection.StateQA.LabelText": "State Q&A",
    "SC.Widgets.App.ToolsSection.StateQA.Description": "Dive in to state-specific issues to get the answer you need for your jurisdiction. Working with local experts, Practical Law editors have created content that answers common legal questions across multiple practice areas and topics.",
    "SC.Widgets.App.ToolsSection.CountryQA.LabelText": "Country Q&A",
    "SC.Widgets.App.ToolsSection.CountryQA.Description": "Get the global view on common legal issues. Working with local experts in over 125 countries, Practical Law editors have created content that answers common legal questions across multiple practice areas and topics.",
    "SC.Widgets.App.ToolsSection.Waywo.LabelText": "WAYWO",
    "SC.Widgets.App.ToolsSection.Waywo.Description": "Get the answers you need faster with the help of Practical Law editors. What Are You Working On gives you direct access to our experts. Tell us what you are researching, and we'll send you the Practical Law resources to help.",
    "SC.Widgets.App.ToolsSection.GradingTool.LabelText": "Grading Tool",
    "SC.Widgets.App.ToolsSection.PLAskPlus.Description": "Boost your research with AI-assisted answers to legal questions with links to Practical Law resources.",
    "SC.Widgets.App.ToolsSection.LearnMoreDynamicApps": "Learn more about Dynamic Tools",
    "SC.Widgets.App.ToolsSection.BannerHeader": "Discover Dynamic Tools",
    "SC.Widgets.App.ToolsSection.BannerDescription": "Learn about new Practical Law features that can connect you to content faster than ever before!",
    "SC.Widgets.App.ToolsSection.BannerButton": "Learn more",
    "SC.Widgets.App.ToolsSection.BannerBadgeNew": "New",
