    "SC.Widgets.App.ToolsSection.InteractiveMatterMaps.Label": "Interactive Matter Maps",
    "SC.Widgets.App.ToolsSection.InteractiveMatterMaps.Description": "The Dynamic Tool Set adds powerful customization to Matter Maps, making them interactive. Customize our template tasks and resources. Add your own tasks from scratch. Focus on the tasks and resources you are interested in, in the order you need, and share your map with others in your team.",
    "SC.Widgets.App.ToolsSection.DynamicWhatsMarketAnalytics.Label": "What's Market Analytics",
    "SC.Widgets.App.ToolsSection.DynamicWhatsMarketAnalytics.Description": "The Dynamic Tool Set adds What’s Market Analytics to What's Market. Analyze state legislation, agreement terms and filings. Build comparison tables and visuals to bring trends and comparisons to life. Let us do the repetitive work for you.",
    "SC.Widgets.App.ToolsSection.DynamicKnowledgeGraph.Description": "Navigate Practical Law content and discover related issues with ease. Knowledge Map's visual display allows you to quickly gain insights, accelerate your research, and be confident that you have uncovered related issues. Combines innovative visual browsing with our expert editors' analysis of related topics, issues, and projects.",
    "SC.Widgets.App.ToolsSection.DynamicQuickCompare.Description": "Build customizable charts comparing legal requirements across multiple jurisdictions at a glance. Quick Compare allows you to easily see the data points you are comparing while also allowing you to see more detail when you choose.",
