    "SC.Analytics.Profiler.CoverageInfo.AdditionalMatches": "When a party in a docket does not contain enough information to confirm it is the same entity as a company in the Thomson Reuters Organization Authority, the dockets for that party can be added to your report as additional matches to the company name you have searched.",
    "SC.Analytics.Profiler.CoveragePage.Header.Westlaw": "Westlaw Edge",
    "SC.Analytics.Profiler.CoveragePage.Header.IndigoPremium.Westlaw": "Westlaw Precision",
    "SC.Analytics.Profiler.CoveragePage.Header.Title": "Litigation Analytics Coverage",
    "SC.Analytics.Profiler.CoveragePage.Tabs.List": "Coverage list by court name",
