    "SC.Analytics.Profiler.CoveragePage.Tabs.Explanation": "Explanation of coverage",
    "SC.Analytics.Profiler.CoveragePage.Tabs.Summary": "Coverage summary by state",
    "SC.Analytics.Profiler.CoveragePage.Explanation.Title": "Explanation of coverage",
    "SC.Analytics.Profiler.CoveragePage.Explanation.Data.Header": "The data in Litigation Analytics can be incomplete",
    "SC.Analytics.Profiler.CoveragePage.Explanation.Data.Body": "Although Litigation Analytics does not yet have data from every jurisdiction in the United States, we are always working to expand our coverage and improve accuracy. Despite our vast docket collection, our data can sometimes be incomplete.",
    "SC.Analytics.Profiler.CoveragePage.Explanation.Timeliness.Header": "Timeliness",
    "SC.Analytics.Profiler.CoveragePage.Explanation.Timeliness.Body": "Data for Litigation Analytics is gathered from electronic copies of court dockets. Occasionally, a court will change its docket format; this can cause delays as we develop our ability to read the new format, interrupting our flow of new data for a period of time. Use the \"Update\" button to ensure that you are viewing the newest version of a docket.",
    "SC.Analytics.Profiler.CoveragePage.Explanation.Coverage.Header": "Coverage",
    "SC.Analytics.Profiler.CoveragePage.Explanation.Coverage.Body.Item1": "Our federal dockets coverage is broad and deep. We have motions, outcomes, judges, courts, law firms, and attorneys going back over 20 years in every U.S. District Court. We also have data from U.S. Courts of Appeals, the Supreme Court of the United States, some federal specialty courts, and both the Patent and Trademark Trial and Appeal Boards.",
    "SC.Analytics.Profiler.CoveragePage.Explanation.Coverage.Body.Item2": "Our state-court dockets coverage varies. For some states, we cover civil courts statewide; for other states, we might only cover major counties. Coverage dates also vary: for some state courts, our data goes back as far as 1973; in other jurisdictions, our data collection has stopped due to changes to docket format or to our permission to access the data. In select jurisdictions, we have detailed motions data in addition to the general information about each proceeding.",
    "SC.Analytics.Profiler.CoveragePage.Explanation.Results.Header": "Results can be incomplete for many reasons",
    "SC.Analytics.Profiler.CoveragePage.Explanation.Results.Body.Item1": "We do not have state-court coverage in every state.",
    "SC.Analytics.Profiler.CoveragePage.Explanation.Results.Body.Item2": "In some states where we do have coverage, we do not cover every court.",
    "SC.Analytics.Profiler.CoveragePage.Explanation.Results.Body.Item3": "For some courts, the docket itself excludes important points like the names of judges, attorneys, or law firms.",
    "SC.Analytics.Profiler.CoveragePage.Explanation.Results.Body.Item4": "Updates may be delayed when a court changes its docket format.",
    "SC.Analytics.Profiler.CoveragePage.Explanation.Results.Body.Item5": "For motion analytics, we only count motions that have been resolved by a court order. Not all motions are resolved with an order, so the number of motions we show is fewer than the total number of motions filed.",
    "SC.Analytics.Profiler.CoveragePage.Explanation.Results.Body.Item6": "For some courts, we have stopped receiving new data; when that happens, we display a warning along with the search results.",
    "SC.Analytics.Profiler.CoveragePage.Explanation.Damages.Header": "Damages Coverage",
    "SC.Analytics.Profiler.CoveragePage.Explanation.Damages.Body": "Damages are derived from selected Federal District Court dockets that include monetary awards and/or attorney fees or litigation costs. Only those dockets where all damages could be ascertained with sufficient confidence are included.",
    "SC.Analytics.Profiler.CoveragePage.Explanation.Transparency.Header": "Transparency",
    "SC.Analytics.Profiler.CoveragePage.Explanation.Transparency.Body": "As part of Westlaw's commitment to transparency, we provide several tools to help our users understand our coverage. Those tools include this explanation, a coverage map, and an interactive database of complete coverage details for each court. Familiarizing yourself with the completeness of our data for any court you want to analyze will help you draw better conclusions from the results you see in Litigation Analytics.",
    "SC.Analytics.Profiler.CoveragePage.Maps.Title": "Coverage maps",
    "SC.Analytics.Profiler.CoveragePage.Maps.Title.Subtext": "Maps of our state and federal data coverage at the county level",
    "SC.Analytics.Profiler.CoveragePage.Maps.State.Header": "State data coverage",
    "SC.Analytics.Profiler.CoveragePage.Maps.Federal.Header": "Federal data coverage",
    "SC.Analytics.Profiler.CoveragePage.List.Title": "Coverage list by court name",
    "SC.Analytics.Profiler.CoveragePage.List.Title.Subtext": "Go deep into the data behind Litigation Analytics with this filterable list of coverage, detailed court by court. On other tabs, you will find maps of our state and federal coverage, an explanation of what data we have and why, and a summary of our coverage within individual states. To find a specific court by name, use control + F.",
