    "SC.Core.Indigo.LegalSimilarity.Lightbox.AreaOfLaw.InfoText": "Find cases from a specific legal subject matter to ensure the legal issues, facts and claims are arising in the correct context. <strong>Examples:</strong> Commercial Law or Federal Civil Procedure",
