    "SC.Search.PermissibleUse.Info.STCD": "Are you using this product for skip tracing related to consumer debt collection?",
    "SC.Search.PermissibleUse.DisplayName.STCD": "Skip Tracing for Consumer Collections Declaration",
    "SC.Search.PermissibleUse.Info.Fcra": "Thomson Reuters Legal is not a consumer reporting agency and none of its services or the data contained therein constitute a &ldquo;consumer report&rdquo; as such term is defined in the Federal Fair Credit Reporting Act (FCRA), 15 U.S.C. sec. 1681 et seq. The data provided to you may not be used as a factor in consumer debt collection decisioning, establishing a consumer&rsquo;s eligibility for credit, insurance, employment, government benefits, or housing, or for any other purpose authorized under the FCRA. By accessing one of our services, you agree not to use the service or data for any purpose authorized under the FCRA or in relation to taking an adverse action relating to a consumer application.",
    "SC.Search.PermissibleUse.Help.FullText": "The information on this site may be regulated by laws that restrict the use of that information, including but not limited to the Drivers&rsquo; Privacy Protection Act, 18 U.S.C. &sect 2721 et seq., or similar state laws (collectively &ldquo;DPPA&rdquo;), the Gramm-Leach-Bliley Act, 15 U.S.C. 6801 et seq. (&ldquo;GLBA&rdquo;), various Federal and State laws, regulations, and rules as well as your Subscriber Agreement. By using this service, you represent and warrant that information regulated by these authorities including DPPA and GLBA will only be used for the purpose selected in the appropriate drop down box. If you do not have a permissible use, you must select &ldquo;no permissible use,&rdquo; and you will not be given access to that information.",
    "SC.Search.PermissibleUse.UpdateLink.Text": "Update Permissible Uses",
