    "SC.Search.PermissibleUse.CUSOLightbox.MessageLineOne": "Westlaw Public Records has been optimized to provide collections customers with the most relevant and up-to-date information to quickly and efficiently locate people.  We have added a new permissible use selection whereby customers engaged in skip-tracing related to consumer debt collection must certify their use case.  Failure to do so may result in remedial action up to and including termination of your access to the product.  Additional information can be found in the \"Skip Tracing for Consumer Debt Collections FAQs\" accessible from Public Records search templates or by clicking {anchorHtml}.",
