    "SC.Search.Indigo.SearchTips.Thesaurus.Content": "Use synonyms and related concepts to enhance your Terms &amp; Connectors searches in the global search bar or on Advanced Search Templates. The Thesaurus will display automatically in the typeahead menu when the global search bar detects Boolean Connectors in your query.",
    "SC.Search.Indigo.SearchTips.Select.Highlighting.Content": "Focus on specific terms and concepts in your search results by selecting up to five different highlighting colors.<p>Access Select Highlighting by clicking the highlighter icon<span class=\"SelectHighlightingExample icon25 icon_marker-blue\"></span>on a search result list or a document.</p>",
    "SC.Search.Indigo.SearchTips.Select.Highlighting.Content.SnippetNav": "Select up to five different colors to highlight your most important terms or use your selected terms to generate new snippets for your search results.<p>Access Select Highlighting by clicking the highlighter icon<span class=\"SelectHighlightingExample icon25 icon_marker-blue\"></span>on a search result list or a document.</p>",
    "SC.Search.Indigo.SearchTips.Term.Emphasis.Content": "<p>Add emphasis to your most important search terms if your initial search did not return desired results. Search Term Emphasis can promote documents containing the emphasized terms. Also available on Search Within search results.</p><p>Apply Search Term Emphasis by adding a caret <sup>'^'</sup> after an important term. The caret symbol <sup>'^'</sup> is above the 6 on the keyboard.</p><div class=\"AdvancedSearchTipsExample\"><strong>Examples: </strong><em>dog canine /p detect! /s drug /p trunk tire^ car automobile</em><br/><em>qualified immunity excessive force taser^</em></div>",
    "SC.Search.Indigo.SearchTips.Plain.Language.Content": "<p>Enter sentences or descriptive terms for your legal issue and Westlaw Edge will automatically look for word and phrase variations.</p><p>To enhance your plain language search:</p><ul class=\"co_listBullet\"><li>Place <strong>quotation marks</strong> around phrase concepts.</li><li><strong>Require/Exclude terms</strong>-use a '<strong>+</strong>' to <strong>require </strong>a term or phrase in every document in your search results and use a '<strong>-</strong>' to <strong>exclude </strong>a term or phrase from every document in your search results.</li></ul><div class=\"AdvancedSearchTipsExample\"><strong>Examples:</strong><em>termination of college coaching contracts +\"for cause\"</em><br/><em>civil rico violation -\"puerto rico\"</em></div>",
    "SC.Search.Indigo.SearchTips.Plain.Language.IndigoPremium.Content": "<p>Enter sentences or descriptive terms for your legal issue and Westlaw Precision will automatically look for word and phrase variations.</p><p>To enhance your plain language search:</p><ul class=\"co_listBullet\"><li>Place <strong>quotation marks</strong> around phrase concepts.</li><li><strong>Require/Exclude terms</strong>-use a '<strong>+</strong>' to <strong>require </strong>a term or phrase in every document in your search results and use a '<strong>-</strong>' to <strong>exclude </strong>a term or phrase from every document in your search results.</li></ul><div class=\"AdvancedSearchTipsExample\"><strong>Examples:</strong><em>termination of college coaching contracts +\"for cause\"</em><br/><em>civil rico violation -\"puerto rico\"</em></div>",
    "SC.Search.Indigo.SearchTips.Boolean.Content": "To run your search as Boolean Terms &amp; Connectors, you can:<ul class=\"co_listBullet\"><li>Include Boolean connectors and expanders:<table class=\"BooleanTermsTable\"><tbody><tr><td class=\"BooleanConnectorExample\">/s</td><td>In same sentence</td></tr><tr><td class=\"BooleanConnectorExample\">+s</td><td>In same sentence and in same order</td></tr><tr><td class=\"BooleanConnectorExample\">/p</td><td>In same paragraph</td></tr><tr><td class=\"BooleanConnectorExample\">+p</td><td>In same paragraph and in same order</td></tr><tr><td class=\"BooleanConnectorExample\">/[n]</td><td>Within n (1-255) terms of</td></tr><tr><td class=\"BooleanConnectorExample\">+[n]</td><td>Within n (1-255) terms of and in same order</td></tr><tr><td class=\"BooleanConnectorExample\">%</td><td>But not</td></tr><tr><td class=\"BooleanConnectorExample\">[SPACE]</td><td>OR connector</td></tr><tr><td class=\"BooleanConnectorExample\">&amp;</td><td>AND connector</td></tr><tr><td class=\"BooleanConnectorExample\">!</td><td>Root expander suffix for variant endings</td></tr><tr><td class=\"BooleanConnectorExample\">*</td><td>Universal single character(s) (cannot start term)</td></tr><tr><td class=\"BooleanConnectorExample\">#</td><td>Prefix to turn off plurals and equivalents</td></tr></tbody></table></li><li>Or preface your search with 'adv:'</li></ul><br/><p><strong>NOTE:</strong> AND, &amp;, OR, or a phrase within quotation marks will NOT automatically trigger a Terms &amp; Connectors search. To change this behavior, adjust your settings in the <strong>Search</strong> tab within <strong>Preferences.</strong></p><p>To enhance your Terms &amp; Connectors search:</p><ul class=\"co_listBullet\"><li>Click the Advanced link next to the Search button to access a search template with pre-defined fields specific to the content being searched to help you build a Boolean query.</li><li>To increase the number of words before and after your search terms in the result list snippets, adjust your settings in the <strong>Search tab</strong> within Preferences.</li></ul>",
    "SC.Search.Indigo.SearchTips.Command.Shortcuts.Content": "<p>Enter a single document citation to retrieve that document automatically. A search for the citation terms will be run if the citation is not recognized. Enter the FIND Command 'fi:' before a document citation to retrieve only that document without searching for an unrecognized citation. To retrieve multiple documents, use 'fi:' and separate your citations with semicolons.</p><div class=\"AdvancedSearchTipsExample\"><strong>Example:</strong><em>FI: 347 U.S. 483; 410 U.S. 413; 135 S.Ct. 2584.</em></div><p>Enter the KEYCITE command 'kc:' into the search box before a document citation to go directly to the KeyCite information for that document.</p><div class=\"AdvancedSearchTipsExample\"><strong>Example:</strong><em>KC: 411 U.S. 792.</em></div></div>",
    "SC.Search.Indigo.SearchTips.Help.Content": "For more help on searching in Westlaw Edge, please visit <a href=\"https://legal.thomsonreuters.com/en/support/westlaw-edge\" target=\"_blank\">Training and support<span class=\"icon25 icon_launch-blue\"/></a> You may also contact our Reference Attorneys by Live Chat, or by phone at {ProductImproveFullNumber}.",
    "SC.Search.Indigo.SearchTips.Help.IndigoPremium.Content": "For more help on searching in Westlaw Precision please visit <a href=\"https://legal.thomsonreuters.com/en/support/westlaw-edge\" target=\"_blank\">Training and support<span class=\"icon25 icon_launch-blue\"/></a> You may also contact our Reference Attorneys by Live Chat, or by phone at {ProductImproveFullNumber}.",
    "SC.Search.Indigo.SearchTips.KeyboardInstructions.InstructionsText": "To scroll through content, press the <strong>Up</strong> and <strong>Down</strong> arrow keys. To move from section to section, press the <strong>Tab</strong> key.",
