    "SC.Website.Indigo.LegalAnalytics.OnboardingTour.Step1.Content": "Start your research by typing the name of a legal professional, court, or case type in the search box.  As you type, we will display relevant results directly in the type ahead.",
    "SC.Website.Indigo.LegalAnalytics.OnboardingTour.Step2.Content": "<p>Litigation Analytics delivers relevant, data-driven insights from state and federal dockets and cases to help you manage client expectations and build a winning case strategy--from initial case assessment, all the way to appeal.</p></br><p>Each Litigation Analytics entity has an overview, which provides a snapshot of data about that entity.</p></br><p>The tabs across the top of the page list the reports we have available for that particular entity. Report availability varies by entity type.</p>",
    "SC.Website.Indigo.LegalAnalytics.OnboardingTour.Step2.SearchResults.Content": "Running a search in Litigation Analytics will return relevant results where Westlaw Edge has analytics.",
    "SC.Website.Indigo.LegalAnalytics.OnboardingTour.Step2.SearchResults.IndigoPremium.Content": "Running a search in Litigation Analytics will return relevant results where Westlaw Precision has analytics.",
    "SC.Website.Indigo.LegalAnalytics.OnboardingTour.Step3.Content": "Each Litigation Analytics report has search within capability, which helps you find documents that contain the keywords you need. The advanced search within capability allows you to search the text of dockets as well as their related filings.",
    "SC.Website.Indigo.LegalAnalytics.OnboardingTour.Step4.Content": "Each Litigation Analytics report has full filtering capability that allows you to narrow down the result list to exactly what you are looking for, which helps you find matters that are most like yours.",
    "SC.Website.Indigo.LegalAnalytics.OnboardingTour.Step5.Content": "Each Litigation Analytics report has a data visualization component with different views of the data that make up the result list. For example, you can easily see the likelihood of a motion type being granted, and with one click, you can toggle over and see how long it will take for that motion type to get a final ruling.",
    "SC.Website.Indigo.LegalAnalytics.OnboardingTour.Step6.Content": "Each Litigation Analytics report has a result list of all dockets we have for a particular entity. In addition to having a link to the docket, we also provide links to the motion and orders, as well as, any other related filings for the case.",
    "SC.Website.Indigo.LegalAnalytics.OnboardingTour.Step2.SpecialBox": "Select <b>{tabName}</b> to continue",
