    "SC.Website.Indigo.LegalAnalytics.OnboardingTour.TakeTour": "Litigation Analytics is an exciting new feature included in Westlaw Edge that delivers relevant, data-driven insights from state and federal dockets and cases to help you manage client expectations and build a winning case strategy. Would you like a brief tour?",
    "SC.Website.Indigo.LegalAnalytics.OnboardingTour.IndigoPremium.TakeTour": "Litigation Analytics is an exciting feature included in Westlaw Precision that delivers relevant, data-driven insights from state and federal dockets and cases to help you manage client expectations and build a winning case strategy. Would you like a brief tour?",
