    "SC.Website.Indigo.LegalAnalytics.Skopos.MoreInfoLightbox.Content.Paragraph1": "Skopos provides a prediction of the probability a bill will pass both chambers and be signed into law by the President.  Variables considered include, but are not limited to, 1) the full text of the bill, 2) political and legislative variables such as the bill’s sponsor and the political composition of the Congress, and 3) variables external to the legislative process such as GDP, the unemployment rate, and catastrophic events.",
    "SC.Website.Indigo.LegalAnalytics.Skopos.MoreInfoLightbox.Content.Paragraph2": "Scores reflect the probability of enactment for the most recent version of the bill text.  Scores of 100% indicate the bill has been signed by the President.  Refer to US Public Laws for signing date.",
    "SC.Website.Indigo.LegalAnalytics.Skopos.MoreInfoLightbox.Footer": "Powered by Skopos Labs",
