    "SC.Website.Indigo.HomePage.OnboardingTour.CloseTooltip": "Close",
    "SC.Website.Indigo.HomePage.OnboardingTour.TakeTour": "Would you like a brief tour of some of the new Westlaw Edge features that can help you complete your research faster and more effectively?",
    "SC.Website.Indigo.HomePage.OnboardingTour.IndigoPremium.TakeTour": "Would you like a brief tour of some of the Westlaw Precision features that can help you complete your research faster and more effectively?",
    "SC.Website.Indigo.HomePage.OnboardingTour.Step1": "Start typing a question in the search bar, and type ahead will provide a range of questions based on the legal terms you enter. Click on the type ahead question that best matches what you were asking and it will take you to the law summary with supporting case law.",
    "SC.Website.Indigo.HomePage.OnboardingTour.Step2": "The <b>Search Suggestions</b> feature provides type ahead suggestions as you enter terms into the search bar.  Find cases specific to your legal issue by clicking on the suggestion which best matches what you are researching and it will take you to relevant case law results.",
    "SC.Website.Indigo.HomePage.OnboardingTour.Step3": "<b>Litigation Analytics</b> provides data analysis and visualizations for federal district court judges. As you type the name of a judge into the search bar, <b>Litigation Analytics</b> will suggest questions regarding that judge's history of ruling on common motions.<br></br> In addition, typing the name of a legal professional, company, or popular statute will provide an overview of that entity in the type ahead with a link to its Snapshots profile.",
    "SC.Website.Indigo.HomePage.OnboardingTour.Step4": "The type ahead drop-down options are organized by content type to make searching quicker and more intuitive. As you enter search terms, the type ahead options will automatically shift to the most relevant suggestion and content type.",
    "SC.Website.Indigo.HomePage.OnboardingTour.Step5": "Westlaw Edge will provide a notification when a colleague shares content such as folders, notes, highlights, or snippets with you. You will also see notifications within Westlaw Edge when alerts you created find documents. <b>Notifications</b> will also be shown when Westlaw Edge has document recommendations for you based on your research.",
    "SC.Website.Indigo.HomePage.OnboardingTour.IndigoPremium.Step5": "Westlaw Precision will provide a notification when a colleague shares content such as folders, notes, highlights, or snippets with you. You will also see notifications within Westlaw Precision when alerts you created find documents. <b>Notifications</b> will also be shown when Westlaw Precision has document recommendations for you based on your research.",
    "SC.Website.Indigo.HomePage.OnboardingTour.Step6": "You can manage which notifications you receive in the Preferences section of your Profile in the Westlaw Edge header.",
    "SC.Website.Indigo.HomePage.OnboardingTour.IndigoPremium.Step6": "You can manage which notifications you receive in the Preferences section of your Profile in the Westlaw Precision header.",
    "SC.Website.Indigo.HomePage.OnboardingTour.Step7": "<b>Quick Check</b> allows you to securely upload your brief or motion to quickly find new authority and related law.<br></br>With <b>Litigation Analytics</b>, you can find insights about judges, courts, and case types to build a winning case strategy.",
    "SC.Website.Indigo.HomePage.OnboardingTour.Step7.NoDocAnalyzer": "With <b>Litigation Analytics</b>, you can find insights about judges, courts, and case types to build a winning case strategy.<br></br>",
