    "SC.Website.Views.Search.Home.Indigo.AI.ConversationalSearch.Tab.LeftPane.Header.AriaLabel": "Welcome to the new Westlaw's AI-Assisted Research",
    "SC.Website.Views.Search.Home.Indigo.AI.ConversationalSearch.Tab.LeftPane.Info.Item1.Format": "Ask a legal research question just the way you think about it, as if you were giving instructions to a colleague. Please see our {tipsModal} for questions this feature does not yet support and suggestions for improving results.",
    "SC.Website.Views.Search.Home.Indigo.AI.ConversationalSearch.Tab.LeftPane.Info.TipsModalTitle": "Tips for best results",
