    "SC.Website.Views.Search.Home.Indigo.AI.ConversationalSearch.Tab.LeftPane.Info.Item2": "AI-Assisted Research uses generative AI and can occasionally produce inaccuracies, so it should always be used as part of a research process in connection with additional research where primary sources are checked to fully understand the nuance of the issues and further improve accuracy.",
