    "SC.Website.Views.Search.Home.Indigo.AI.ConversationalSearch.Tab.RightPane.Tips.Button.Title": "tips for best results",
    "SC.Website.Views.Search.Home.Indigo.AI.ConversationalSearch.AIWorks.Treatise.Expansion.Rutter.Info1": "Search & Summarize Rutter uses large language models - a type of generative AI - and focuses the models only on the language of the Rutter Group Practice Guides.  Please note that three Rutter Group Practice Guides will not be used by the models or included in a response: 1) <em>California Law & Motion Model Forms</em>, 2) <em>LPI Legal Professional's Handbook</em>, and 3) <em>Public Sector Employment Litigation</em>.",
    "SC.Website.Views.Search.Home.Indigo.AI.ConversationalSearch.AIWorks.Treatise.Expansion.OConnors.Info1": "Search & Summarize O'Connor's uses large language models - a type of generative AI - and focuses the models only on the language of O'Connor's Commentaries and Forms. Please note that Search & Summarize O'Connor's does not leverage O'Connor's Codes & Rules content.",
    "SC.Website.Views.Search.Home.Indigo.AI.ConversationalSearch.AIWorks.Treatise.Expansion.Tax.Info1": "Search & Summarize Tax uses large language models - a type of generative AI - and focuses the models only on Internal Revenue Service (IRS) administrative content.",
    "SC.Website.Views.Search.Home.Indigo.AI.ConversationalSearch.AIWorks.Treatise.Expansion.Rutter.Info2": "Portions from Rutter Group Practice Guides are used in the responses and may include the actual language from the source or references to primary law. Links are included to read the full text of the source documents. Even with these and other precautions, Search & Summarize Rutter can occasionally produce inaccuracies, so it should always be used as part of a research process in connection with additional research to fully understand the nuance of the issues and further improve accuracy.",
    "SC.Website.Views.Search.Home.Indigo.AI.ConversationalSearch.AIWorks.Treatise.Expansion.OConnors.Info2": "Portions from O'Connor's Commentaries and Forms are used in the responses and may include the actual language from the source or references to primary law. Links are included to read the full text of the source documents. Even with these and other precautions, Search & Summarize O'Connor's can occasionally produce inaccuracies, so it should always be used as part of a research process in connection with additional research to fully understand the nuance of the issues and further improve accuracy.",
    "SC.Website.Views.Search.Home.Indigo.AI.ConversationalSearch.AIWorks.Treatise.Expansion.Tax.Info2": "Portions from IRS administrative documents are used in the responses and may include the actual language from the source. Links are included to read the full text of the source documents. Even with these and other precautions, Search & Summarize Tax can occasionally produce inaccuracies, so it should always be used as part of a research process in connection with additional research to fully understand the nuance of the issues and further improve accuracy.",
    "SC.Website.Views.Search.Home.Indigo.AI.ConversationalSearch.AIWorks.Treatise.Info3": "<strong>The AI-generated summary above the list of documents can be extraordinarily useful for getting an overview of the issues and pointers, but it should <em>never</em> be used to advise a client, write a brief or motion for a court, or otherwise be relied on without doing further research.</strong>",
    "SC.Website.Views.Search.Home.Indigo.AI.ConversationalSearch.AIWorks.Treatise.Expansion.Tax.Info3": "<strong>The AI-generated summary above the list of documents can be extraordinarily useful for getting an overview of the issues, but it should <em>never</em> be used to advise a client, write a brief or motion for a court, or otherwise be relied on without doing further research.</strong>",
    "SC.Website.Views.Search.Home.Indigo.AI.ConversationalSearch.AIWorks.Treatise.Expansion.Rutter.Info4": "Use it to accelerate thorough research. <strong>Don't use it as a <em>replacement</em> for thorough research.</strong> Also, because Search & Summarize Rutter is relying on a treatise that is updated periodically but not daily, keep in mind that statements of law should be checked for currency as though using any secondary source content.",
    "SC.Website.Views.Search.Home.Indigo.AI.ConversationalSearch.AIWorks.Treatise.Expansion.OConnors.Info4": "Use it to accelerate thorough research. <strong>Don't use it as a <em>replacement</em> for thorough research.</strong> Also, because Search & Summarize O'Connor's is relying on a treatise that is updated periodically but not daily, keep in mind that statements of law should be checked for currency as though using any secondary source content.",
    "SC.Website.Views.Search.Home.Indigo.AI.ConversationalSearch.AIWorks.Treatise.Expansion.Tax.Info4": "Use it to accelerate thorough research. <strong>Don't use it as a <em>replacement</em> for thorough research.</strong>",
    "SC.Website.Views.Search.Home.IndigoPremium.ParallelSearch.Feature.Description": "Find relevant cases with conceptually similar sentences, even when they do not use the exact words in your query.",
    "SC.Website.Views.Search.Home.IndigoPremium.ParallelSearch.Feature.Title": "Parallel Search",
    "SC.Website.Views.Search.Home.Indigo.FedRamp.Modal.Content1": "When you access the Thomson Reuters Westlaw platform, we grant a non-exclusive, non-transferable, limited license to you to use the product in the regular course of your work, per the terms of your organization's agreement with Thomson Reuters.",
    "SC.Website.Views.Search.Home.Indigo.FedRamp.Modal.Content2": "Unauthorized use of this system is prohibited and subject to civil and/or criminal penalties.",
