    "SC.Website.Views.AALP.ParallelSearch.Landing.LandingInfo": "Enter a sentence or legal concept to find cases with conceptually similar sentences. Parallel Search understands synonyms and relationships between words and ideas, so it finds relevant cases even if they do not use your exact words.",
