    "SC.Website.Views.AALP.ParallelSearch.Landing.SearchTips.Dialog.SentenceQuery.Heading": "Enter a sentence or legal concept to find cases with conceptually similar sentences.",
    "SC.Website.Views.AALP.ParallelSearch.Landing.SearchTips.Dialog.SentenceQuery.Paragraph": "Write your query as a full sentence of between 5 and 30 words. Query length has an impact on the length of results returned, and a short phrase may not produce useful results. A query that’s a lengthy paragraph can also be problematic.",
    "SC.Website.Views.AALP.ParallelSearch.Landing.SearchTips.Dialog.SentenceQuery.Query": "403 drug possession dwi",
    "SC.Website.Views.AALP.ParallelSearch.Landing.SearchTips.Dialog.SentenceQuery.BetterQuery": "Possession of drugs is inadmissible in a DWI prosecution under rule 403.",
    "SC.Website.Views.AALP.ParallelSearch.Landing.SearchTips.Dialog.LegalConcept.Heading": "Include a legal concept in addition to any factual statements.",
    "SC.Website.Views.AALP.ParallelSearch.Landing.SearchTips.Dialog.LegalConcept.Paragraph": "Parallel Search can work with any type of sentence, but it returns sentences from the common law (i.e. judicial opinions). Due to the nature of the underlying data, sentence queries that are either a legal concept or a hybrid statement of legal concept and fact will typically find the most on-point results.",
    "SC.Website.Views.AALP.ParallelSearch.Landing.SearchTips.Dialog.LegalConcept.Query": "labels were objectively false about size or quantity",
    "SC.Website.Views.AALP.ParallelSearch.Landing.SearchTips.Dialog.LegalConcept.BetterQuery": "It is a deceptive trade practice for a seller to misrepresent the size or quantity on a label.",
    "SC.Website.Views.AALP.ParallelSearch.Landing.SearchTips.Dialog.AdditionalTips.Heading": "Additional tips:",
    "SC.Website.Views.AALP.ParallelSearch.Landing.SearchTips.Dialog.AdditionalTips.Tip1": "When searching for concepts that are frequently discussed in the common law, small adjustments to your query can result in pronounced changes in your results. Try slightly rephrasing your query to fine-tune your results.",
    "SC.Website.Views.AALP.ParallelSearch.Landing.SearchTips.Dialog.AdditionalTips.Tip2": "Parallel Search considers punctuation when analyzing queries but ignores capitalization.",
    "SC.Website.Views.AALP.ParallelSearch.Landing.SearchTips.Dialog.AdditionalTips.Tip3": "Sentences that occur frequently throughout the law will likely bring back verbatim results.",
    "SC.Website.Views.AALP.ParallelSearch.Landing.SearchTips.Dialog.AdditionalTips.Tip4": "Parallel Search will return up to 25 of the most relevant results per search query.",
