    "SC.Website.Views.AALP.ParallelSearch.Facets.SearchWithin.BooleanInstructions.Item1": "Use quotation marks to search for entire phrases, such as <strong>\"Securities Exchange Act\"</strong> or <strong>\"Access to Information Act\"</strong>",
    "SC.Website.Views.AALP.ParallelSearch.Facets.SearchWithin.BooleanInstructions.Item2": "Use the operator AND to search for all terms connected by the AND, such as <strong>civil AND liability</strong> or <strong>liability AND easement</strong>",
    "SC.Website.Views.AALP.ParallelSearch.Facets.SearchWithin.BooleanInstructions.Item3": "Use terms and connectors to narrow your search scope, such as <strong>personal /3 jurisdiction</strong> or <strong>liability /s venue</strong>",
