    "SC.Website.LegalSimilarity.SearchTemplate.LegalIssue.InfoText": "Use Precision Research to quickly find cases involving your specific legal question and the related outcome on that issue.<br><strong>Example:</strong> Legal Issue: Subject Matter Jurisdiction  >  Sovereign Immunity<br>Outcome: Found",
    "SC.Website.LegalSimilarity.SearchTemplate.FactPattern.InfoText": "Use common language to find factually similar cases or to identify common legal issues and claims that are implicated by the scenario.<br><strong>Examples:</strong> Late Delivery or Failure to Deliver Goods",
    "SC.Website.LegalSimilarity.SearchTemplate.CauseOfAction.InfoText": "Find legal claims that allow parties to seek judicial relief, which can help clarify a legal issue or surface other related claims.<p><strong>Examples:</strong> Breach of Contract or Unjust Enrichment</p>",
    "SC.Website.LegalSimilarity.SearchTemplate.MotionType.InfoText": "Find cases that dispose of the motion in which you're interested, including specific outcomes at trial and appeal.<p><strong>Example:</strong> Motion for Summary Judgment > Denied</p>",
    "SC.Website.LegalSimilarity.SearchTemplate.PartyType.InfoText": "Search or filter to find cases that include parties relevant to your current matter.<br><strong>Examples:</strong> Accountant or Mortgagor",
    "SC.Website.LegalSimilarity.SearchTemplate.IndustryType.InfoText": "Find cases that involve legal issues or claims relevant to a specific industry or field of business.<br><strong>Examples:</strong> Banking and Financial Services, Insurance, or Real Estate",
    "SC.Website.LegalSimilarity.SearchTemplate.AreaOfLaw.InfoText": "Find cases from a specific legal subject matter to ensure the legal issues, facts and claims are arising in the correct context.<br><strong>Examples:</strong> Commercial Law or Federal Civil Procedure",
    "SC.Website.LegalSimilarity.SearchTemplate.MaterialFacts.InfoText": "Find cases that include your key terms in the facts that were most pertinent to the court's resolution of a legal dispute.",
    "SC.Website.LegalSimilarity.SearchTemplate.GoverningLaw.Edge.InfoText": "Find cases involving a specific governing law that is relevant to the court's determination on a legal issue.<br><strong>Examples:</strong> Fair Labor Standards Act or Racketeer Influenced and Corrupt Organizations Act",
    "SC.Website.LegalSimilarity.SearchTemplate.GoverningLaw.InfoText": "Find cases involving a specific governing law that is relevant to the court's determination on a legal issue.<br><strong>Examples:</strong> Americans with Disabilities Act or Uniform Commercial Code",
